column.Comment:
Состояние юридического лица, индивидуального предпринимателя:
1)	действующий;
2)	исключен из ЕГР;
3)	находится в процессе ликвидации;
4)	процедура банкротства;
5)	прекращение деятельности в результате реорганизации;
6)	регистрация аннулирована (для индивидуального предпринимателя);
7)	приостановление деятельности (для индивидуального предпринимателя)

Код формы собственности. Список кодов в рамках системы Конфискат:
1) 100;
2) 110;
3) 112;
4) 120;
5) 121;
6) 122;

Требование привязки к товарной группе, заполнять автоматически при определении Типа организации. 0/1/2/3 (0-привязка отсутствует; 1-привязка на уровне ЮЛ/ИП; 2- привязка на уровне структурного подразделения; 3- привязка на уровне сотрудника).
1-для реализующих(1005), аукционистов(1007), промпереработка (1741), иные виды работ (экспертиз) (1781),  добыча нерудных полезных ископаемых (1800), содержание диких животных (2083), идентификация имущества (2081);
2- хранителей(1003); 
3- эксперты-оценщики, товароведческая экспертиза (2082))

